import React, { useState } from "react";
import "../styles/settings.css";

const AddCar = () => {
  const [companyName, setCompanyName] = useState();
  const [modelName, setModelName] = useState();
  const [year, setYear] = useState();
  const [price, setPrice] = useState();
  const [image, setImage] = useState();

  const handleAddCar = (newCar) => {
    console.log("new car", newCar);
    axios
      .post("http://localhost:8000/api/add-car", {
        title: newCar.title,
        subtitle: newCar.subtitle,
        price: newCar.price,
        image: newCar.image,
      })
      .then((res) => {
        console.log(res.data);
      });
  };

  return (
    <div className="settings">
      <div className="settings__wrapper">
        <div className="details__form">
          <h2 className="profile__title">Add New Car</h2>
          <p className="profile__desc">Add all the details about the car</p>
          <form>
            <div className="form__group">
              <div>
                <label>Company Name</label>
                <input type="text" placeholder="Toyota" />
              </div>

              <div>
                <label>Modal Name</label>
                <input type="text" placeholder="Camry" />
              </div>
            </div>

            <div className="form__group">
              <div>
                <label>Year</label>
                <input type="email" placeholder="2002" />
              </div>

              <div>
                <label>Price</label>
                <input type="text" placeholder="17 Million AED" />
              </div>
            </div>

            <div className="form__group">
              <div>
                <label>Car Image</label>
                <p className="profile-img__desc">
                  This will be displayed in the car listing
                </p>
                <input type="file" placeholder="choose file" />
              </div>

              <div className="profile__img-btns">
                <button className="dlt__btn">Delete</button>
                <button className="update__btn">Update</button>
              </div>
            </div>
          </form>
        </div>
        <button type="button" class="btn btn-dark">
          Add Car
        </button>
      </div>
    </div>
  );
};

export default AddCar;
